import React from "react";

/*
This app was created during "React for Beginners" -course by Wes Bos.

NotFound is a page to prevent 404.
If user types something irrelevant to StorePicker's search bar, it takes user to this page. 

For example: /catnip
 */

const NotFound = () => (

    // Title, that says that the page is not found
    <div>
        <h2>Not Found!</h2>
    </div>
);

// exports the page
export default NotFound;
